import Fisico1 from '../img/fisico1.png';
import Fisico2 from '../img/fisico2.png';
import Digital1 from '../img/digital1.png';

export function CardConfig () {
    return [
        {Titulo: 'Convite de casamento físico',
        Texto: 'R$ 3,00 Un.', 
        Img: {Fisico1}, 
        NomeImg:'Fisico1',
        Id:1
        ,Descricao: 'Convite básico para casamento. Entregamos em todo território nacional.'
    },
        {Titulo: 'Convite de casamento digital',Texto: 'R$ 25,00 Un.', Img: {Digital1}, NomeImg:'Digital1',Id:2,Descricao: 'Teste descrição'},
        {Titulo: 'Convite de casamento físico',Texto: 'R$ 10,00 Un.', Img: {Fisico2}, NomeImg:'Fisico2',Id:3,Descricao: 'Teste descrição'},
    ];
}
